import Box from '@mui/material/Box';
import TextField from '@mui/material/TextField';

const styles = theme => ({
    multilineColor:{
        color:'white'
    }
});

export const Search = () => {
   const classes = styles();

   return (
      <Box
         component="form"
         sx={{
         '& > :not(style)': { m: 1, width: '25ch' },
         }}
      noValidate
      autoComplete="off"
      >
         <TextField InputProps={{
    className: classes.multilineColor
  }} id="standard-basic" label="Search Star Wars" variant="standard" />
      </Box>
   );
}
